import React, {Component} from 'react';
  
class ToDo extends Component {
    
    state={ };

    render() {
        return (
        <div className="card m-5" style={{margin:40}}>
            <div className="card-body">
                <div className="row">
                    <div className="col-6">
                       <form>
                          <input type="text" class="form-control" placeholder="Search"/>
                       </form>
                    </div>
               </div>
           </div>
        </div>
        );
    }
}

export default ToDo;
